    false,nt"url": null,nt"notes": "NODC Accession 0112310 includes biological,
    chemical, discrete sample, physical and profile data collected from SHUMPU MARU
    in the Philippine Sea from 1999-10-06 to 1999-10-14 and retrieved during cruise
    PACIFICA_49SU19991006 and SH99-10. These data include ALKALINITY, AMMONIUM, CHLOROFLUOROCARBON-11
    (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12), CHLOROPHYLL A, DELTA CARBON-13, DISSOLVED
    INORGANIC CARBON, DISSOLVED ORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE,
    NITRATE, NITRATE + NITRITE CONTENT (CONCENTRATION), NITRITE, PHAEOPHYTIN, PHOSPHATE,
    Potential temperature (theta), SALINITY, SIGMA-THETA, SILICATE, TOTAL PHOSPHORUS,
    WATER TEMPERATURE and pH. The instruments used to collect these data include CTD,
    Coulometer for DIC measurement and bottle. These data were collected by Hideshi
    Daimon of Japan Meteorological Agency and Masao Ishii of Meteorological Research
    Institute; Geochemical Research Department as part of the PACIFICA_49SU19991006
    data set.nnPACIFICA (PACIFic ocean Interior CArbon) was an international collaborative
    project for the data synthesis of ocean interior carbon and its related parameters
    in the Pacific Ocean. The North Pacific Marine Science Organization (PICES), Section
    of Carbon and Climate (S-CC) supported the project.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
